import React from 'react';
import { Avatar, Card } from 'antd';

const UserProfile = () => {
  return (
    <Card>
      actions=
      {[
        <div key='twit'>
          트윗
          <br />0
        </div>,
        <div key='following'>
          팔로잉
          <br />0
        </div>,
        <div key='follower'>
          팔로워
          <br />0
        </div>,
      ]}
      <Card.Meta avatar={<Avatar>DB</Avatar>} title='Dabin' />
      <Button>로그아웃</Button>
    </Card>
  );
};

export default UserProfile;
